import React from 'react'
import "../Searchcomp.css"
import  TuneIcon  from '@material-ui/icons/Tune';
import Channel from '../components/Channel';

function SearchComp() {
  return (
    <div className='Searchpage'>
    <div className='search_filter'>
    <TuneIcon/>
    <h2>Filter</h2>
    </div>
    <hr/>

    <Channel
    image= "https://www.google.com/imgres?imgurl=https%3A%2F%2F9to5mac.com%2Fwp-content%2Fuploads%2Fsites%2F6%2F2011%2F08%2Fsteve-jobs-authorized-biography-front-and-back-cover.png%3Fw%3D1057&imgrefurl=https%3A%2F%2F9to5mac.com%2Fguides%2Fsteve-jobs%2F&tbnid=norMLJBTkcRSMM&vet=12ahUKEwigpdi-6Kr3AhXIRM0KHVpnBfUQMygLegUIARDsAQ..i&docid=B9z9b2cR16BLAM&w=1057&h=720&q=steve%20jobs&ved=2ahUKEwigpdi-6Kr3AhXIRM0KHVpnBfUQMygLegUIARDsAQ"
    channel="you are cool"
    subs="678K"
    numofvideos={2} 



    />





    </div>
  )
}

export default SearchComp
